import React, { useState } from "react";
import { Link } from 'react-router-dom'
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome"
import { faArrowLeftLong } from "@fortawesome/free-solid-svg-icons"

export default function NewJob() {
    const [open, setOpen] = useState(false)
    const [inputs, setInputs] = useState({})

    const handleChange = (event) => {
        const { name, value } = event.target
        setInputs(prevState => ({ ...prevState, [name]: value }))
    }

    const handleSubmit = (event) => {
        event.preventDefault()
        console.log(inputs)
        //server logic
    }

    const containerStyling = {
        margin:"4em auto 1em auto"
    }

    const applicationContainerStyling = {
        background:"#fcf7eb",
        borderRadius:"10px",
        border:"0.5px solid #303e4d",
        boxShadow: "2px 2px 4px rgba(0, 0, 0, 0.2)",
        margin:"1.5em auto",
        padding:"1em"
    }

    const titleContainerStyling = {
        display:"flex",
        flexDirection:"row"
    }

    const mainTitleStyling = {
        margin:"auto auto auto 0",
        textAlign:"left",
        fontWeight:"500"
    }

    const linkStyling = {
        textDecoration:"none",
        margin:"auto 0 auto auto",
        color:"#303e4d",
        fontSize:"1.25rem"
    }

    const jobInfoContainerStyling = {
        ...titleContainerStyling,
        borderBottom:"0.5px solid #303e4d"
    }

    const leftJobInfoContainerStyling = {
        borderRight: "0.5px solid #303e4d",
        paddingRight:"1em"
    }

    const buttonStyling = {
        background: "#303e4d",
        margin:"4em auto 1em auto",
        width: "160px",
        padding: "0.75em 1.5em",
        border: "none",
        borderRadius: "10px",
        color: "#fffdf8",
        fontFamily: "Montserrat, sans-serif",
        fontSize:"1rem",
        cursor:"pointer"
    }

    const showButtonStyling = {
        ...buttonStyling,
        display: "block"
    }

    const hideButtonStyling = {
        ...buttonStyling,
        display: "none"
    }


    return (
        <div className="new-job-component" style={containerStyling}>
           <div style={titleContainerStyling}>
                <h3 style={mainTitleStyling}>Job Applications</h3>
                <Link to="/job" style={linkStyling}>
                    <FontAwesomeIcon icon={faArrowLeftLong} />
                </Link>
            </div>
            <div style={applicationContainerStyling}>
                <div className="new-job-info-section" style={jobInfoContainerStyling}>
                    <div className="job-info-left" style={leftJobInfoContainerStyling}>
                        <p>Position</p>
                        <p>@Company</p>
                        <p>Company Website</p>
                    </div>
                    <div className="job-info-right">
                        <p>Job ID</p>
                        <p>Application Date</p>
                        <div>Status</div>
                    </div>
                </div>
                <button 
                    onClick={() => setOpen(prev => !prev)} 
                    style={!open? showButtonStyling:hideButtonStyling}> Add Job
                </button>
                {open &&
                    <form onSubmit={handleSubmit}>
                        <label> Position
                            <input 
                                type="text" 
                                name="position"
                                value={inputs.position || ""} 
                                onChange={handleChange}
                            />
                        </label>
                        <label> Company
                            <input 
                                type="text" 
                                name="company"
                                value={inputs.company || ""} 
                                onChange={handleChange}
                            />
                        </label>
                        <label> Company Website
                            <input 
                                type="url" 
                                name="website"
                                value={inputs.website || ""} 
                                onChange={handleChange}
                            />
                        </label>
                        <label> Job ID
                            <input 
                                type="text" 
                                name="jobID"
                                value={inputs.jobID || ""} 
                                onChange={handleChange}
                            />
                        </label>
                        <label> Application Date
                            <input 
                                type="date" 
                                name="date"
                                value={inputs.date || ""} 
                                onChange={handleChange}
                            />
                        </label>
                        <label> Status
                            <input 
                                type="text" 
                                name="status"
                                value={inputs.status || ""} 
                                onChange={handleChange}
                            />
                        </label>
                        <input type="submit" value="Add Job" style={buttonStyling}/>
                    </form>
                }
            </div>
        </div>
    )
}
